import React from "react";

const Statistics = () => {
  return (
    <div className="statistics-div">
      <h1>WeatherAlert</h1>
      <p>
        The most accurate weather page in the world!
        <span className="tiny-text">According to some sources...</span>
      </p>
      <div id="statisticsResult"></div>
    </div>
  );
};

export default Statistics;
